import React, { useState } from "react";
import { Button as ChakraButton, Stack, Input, Box, Image, Text } from '@chakra-ui/react';
import "./login.css";

export default function Login() {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const handleUsernameChange = (event) => {
        setUsername(event.target.value);
    };

    const handlePasswordChange = (event) => {
        setPassword(event.target.value);
    };

    return (
        <Box className="col" display="flex" flexDirection="column" alignItems="center" justifyContent="center">
            <Image id="LOGO" src="LOGO.jpg" alt="Logo" marginBottom="4" />
            <Text className="p1">Username:</Text>
            <Input
                type="text"
                value={username}
                onChange={handleUsernameChange}
                placeholder="Enter Username"
                className="inp1"
            />
            <Text className="p2">Password:</Text>
            <Input
                type="password"
                value={password}
                onChange={handlePasswordChange}
                placeholder="Enter Password"
                className="inp2"
            />
            <ChakraButton className="enter_button">Enter</ChakraButton>
            <Text className="p3">Don't have an account? Register here!</Text>

            {/* Position the Chakra UI button at the bottom right */}
            <Box position="absolute" bottom="20px" right="20px">
                <ChakraButton colorScheme='blue' variant='solid'>
                    Chakra Button
                </ChakraButton>
            </Box>
        </Box>
    );
}
